import "./AgentList.css";
import React, { useEffect, useState } from "react";
import { faTrash, faPencilAlt } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { useDispatch, useSelector } from "react-redux";

import { getAllAgents } from "../../reducers/AgentReducer";
function AgentList() {
  const dispatch = useDispatch();
  const { agentList } = useSelector((state) => state.agent);
  useEffect(() => {
    dispatch(getAllAgents());
  }, []);
  return (
    <div className="p-3">
      <h4>Agent List</h4>
      <table className="table table-sm table-responsive table-hover">
        <thead>
          <tr>
            <th scope="col-4">Agent Id</th>
            <th scope="col-4">Name</th>
            <th scope="col-4">Email</th>
            <th scope="col-4">D.O.B</th>
            <th scope="col-4">CRM Id</th>
            <th scope="col-4">TeleCalling Id</th>
            <th scope="col-4">Address</th>
            <th scope="col-4">License Urn no</th>
            <th scope="col-4">License Expiry Date</th>
            <th scope="col-4">License Issue Date</th>
            <th scope="col-4"></th>
            <th scope="col-4"></th>
          </tr>
        </thead>
        <tbody>
          {agentList &&
            agentList.length > 0 &&
            agentList.map((item, index) => (
              <tr key={item.userId}>
                <td>{item.userId}</td>
                <td>{item.name}</td>
                <td>{item.email}</td>
                <td>{item.dob}</td>
                <td>{item.crmId}</td>
                <td>{item.teleCallingId}</td>
                <td>{item.address}</td>
                <td>{item.licenseUrnNo}</td>
                <td>{item.licenseExpiryDate}</td>
                <td>{item.licenseIssueDate}</td>
                <td>
                  <FontAwesomeIcon
                    className="cursor-pointer"
                    icon={faPencilAlt}
                  />
                </td>
                <td>
                  <FontAwesomeIcon className="cursor-pointer" icon={faTrash} />
                </td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
}

export default AgentList;
